import { useEffect, useState } from "react";
import { fetchAllCommits } from "../services/fetchCommits";

const Dashboard = () => {
  const [commits, setCommits] = useState([]);

  useEffect(() => {
    async function loadCommits() {
      const data = await fetchAllCommits();
      setCommits(data);
    }
    loadCommits();
  }, []);

  return (
    <div>
      <h2>Commit History</h2>
      <ul>
        {commits.map((commit, index) => (
          <li key={index}>
            <strong>{commit.author.login}:</strong> {commit.commit.message} (
            {commit.repository})
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Dashboard;
